text:
@KateChamberlay2 Yes, Sophie Scholl, and other members of the White Rose, were and are an inspiration. 
But, just for the historical record, she wasn't guillotined in December, but in February. 
My pic of the graves of her brother Hans (L), Sophie, &amp; their friend Christoph (R) https://t.co/1Ot24Qil6i

@NorthEssexTory @joerichlaw Sophie Scholl and her small but determined White Rose group were principled and courageous young people, students and teachers, felt they had no choice but to take a stand against Hitler and Nazism.
They knew they'd be executed if/when they were caught.
#AlwaysRemembered

@KatTapestry Calling themselves the White Rose is enough to make my blood boil.

Hans and Sophie Scholl were executed by the Nazis for their resistance.

Despicable to lean onto their legacy.
